import Img from "../src/images/IMG_2212.JPG";
import Img2 from "../src/images/IMG-20180526-WA0060.JPG";
import Img3 from "../src/images/DSC_0537.JPG";

const TeamData = [
    {
        t_name: "Neeraj joshi",
        img_src: {Img},
        position: "Web Designer",
    },
    {
        t_name: "Suraj joshi",
        img_src: {Img2},
        position: "Graphic Designer",
    },
    {
        t_name: "Subash Bist",
        img_src: {Img3},
        position: "Php Developer"
    },
];
export default TeamData;
